import React, { Fragment } from "react";
import ReactLogo from "../../asset/octocat.svg";

// Styling

import { LogoStyle } from "./banner.style";

const Banner = () => {
  return (
    <Fragment>
      <header>

          Get GitHub Info
          <LogoStyle src={ReactLogo} alt="GitHub Logo" />

      </header>
    </Fragment>
  );
};

export default Banner;
